import React from "react";
import "./index.css";
import { FaSleigh } from "react-icons/fa";

class MainMenu extends React.Component {
    constructor(props)
    {
        super(props);

        this.state =
        {
            burger_active: false
        }
      this.burgerToggle = this.burgerToggle.bind(this);
    }
  
    // burgerToggle(x)
    // {
    //    x.classList.toggle("change");
    // }


  render() {
 
    return (
      <nav className="main_navi">
        <ul className="main_ul">
          <li>
            <a className="navi_item" href="#">
              Home
            </a>
          </li>
          <li>
            <a className="navi_item" href="#">
              Our Apartment
            </a>
          </li>
          <li>
            <a className="navi_item" href="#">
              Maledives
            </a>
          </li>
          <li>
            <a className="navi_item" href="#">
              Contact
            </a>
          </li>
          <li>
            <a className="navi_item" href="#">
              Book
            </a>
          </li>
        </ul>

        <div className={this.state.burger_active && 'change'} onClick={() => this.setState({burger_active: !this.state.burger_active})}>
          <div class="bar1"></div>
          <div class="bar2"></div>
          <div class="bar3"></div>
        </div>
      </nav>
    );
  }
}

export default MainMenu;
